import React from 'react'

const Todo = () => {
    const div=document.createElement("div")
    const card=document.createElement("card-group")
    card.appendChild(div)
    const first_node=document.createElement("card-header")
    first_node.removeChild(card)
    const header=document.createElement("h5")
    header.innerHTML="User"
    const body=document.createElement("card-body")
    body.innerHTML="#input-text"
  return (
    <>
    <div className='container-fluid' id='first_division'>
        <h3>My Day</h3>
        <input type={Text} placeholder={"Add a Task"} id={"input-text"} />
        <button id='submit' className='btn btn-primary mt-0 ms-2 pt-1 pb-1'>Add</button>
    </div>

    <div className='container-fluid' id='inner_div'>
        <h4>Lists</h4>
    </div>
    </>
  )
}

export default Todo
